import logo from './logo.svg';
import './App.css';
import Message from './components/Message';
import Counter from './components/Counter';
import Greet from './components/Greet';



function App() {
  return (
    <div className="App">
      <Message />
          <br/>
      <Counter/>

      <Greet/>
      
    </div>
  );
}

export default App;
